import styles from './Navbar.module.css';

function Navbar(){
    return (
        
        <nav className={styles.mainbar}>
            <div className={styles.logo}>
                
            </div>
            <div className={styles.linkcontainer}>
                <span className={styles.navbarele}>
                    <a>Home</a>
                    </span>
            </div>
        </nav>
    );
}

export default Navbar;
